import React, { useEffect } from 'react';
import './CharacterDevelopment.css';

const CharacterDevelopment = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className="character-development">
      <div className="hero-section" style={{ backgroundImage: `url('https://images.unsplash.com/photo-1573164574395-8b2b1b1b1b1b?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80')` }}>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1>Character Development</h1>
          <p>Building values like integrity, respect, and responsibility in all aspects of school life.</p>
        </div>
      </div>
      <div className="content-section">
        <div className="text-content">
          <h2>Our Approach</h2>
          <p>We emphasize mentorship programs, community service, and leadership opportunities to instill strong values in our students.</p>
          <ul>
            <li>Mentorship Programs</li>
            <li>Community Service Initiatives</li>
            <li>Leadership Opportunities</li>
          </ul>
        </div>
        <div className="image-content">
          <img src="https://images.unsplash.com/photo-1573164574395-8b2b1b1b1b1b?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" alt="Character Development" />
        </div>
      </div>
    </div>
  );
};

export default CharacterDevelopment;
